  void testVisitChildrenOf() {
    Set<TermId> children = new TreeSet<>();

    OntologyTerms.visitChildrenOf(
      idRootVegetable,
      ontology,
      (ontology, termId) -> {
      children.add(termId);
      return true;
    });

    assertEquals(
      ImmutableSet.of(
        TermId.of("VO:0000002"),
        TermId.of("VO:0000004"),
        TermId.of("VO:0000005"),
        TermId.of("VO:0000006"),
        TermId.of("VO:0000007")),
      children);
  }

